// src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, Typography, Button, Grid } from '@mui/material';
import { makeStyles } from '@mui/styles';
import './Navbar.css';
const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: 'transperent',
    boxShadow: 'none',
    borderBottom: '1px solid #000'
  },
  brand: {
    textDecoration: 'none',
    color: '#000',
    fontWeight: 'bold',
  },
  button: {
    color: '#000',
    marginLeft: '8px', // Adjust spacing as needed
  },
}));

const Navbar = () => {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.appBar}>
      <Toolbar>
        <Grid container alignItems="center">
          <Grid item xs={12} md={3}>
            <Typography variant="h6" component={Link} to="/" className={classes.brand}>
              Tender App
            </Typography>
          </Grid>
          <Grid item xs={12} md={9}>
            <Grid container justifyContent="flex-end" alignItems="center">
              <Button component={Link} to="/dashboard" className={classes.button}>
                Dashboard
              </Button>
              <Button component={Link} to="/bidding" className={classes.button}>
                Bidding
              </Button>
              <Button component={Link} to="/profile" className={classes.button}>
                About Profile
              </Button>
              <Button component={Link} to="/login" className={classes.button}>
                Login
              </Button>
            </Grid>
          </Grid>
        </Grid>
      </Toolbar>
    </AppBar>
  );
};

export default Navbar;
